        /// <summary>
        /// Gets a texture of an odin logo symbol.
        /// </summary>
        public static Texture2D OdinLogo
        {
            get
            {
                if (odinLogo == null)
                {
                    var bytes = Convert.FromBase64String("");
                    odinLogo = TextureUtilities.LoadImage(86, 75, bytes);
                    CleanupUtility.DestroyObjectOnAssemblyReload(odinLogo);
                }

                return odinLogo;
            }
        }

